import React from 'react';
import './App.css';
import img from './Images/R.jpeg';

class NameForm extends React.Component{
  render(){
    return (
      <div class="main">
        <img src= {img} alt = ""/>
        <form>
          <div className="form-element">
            <input type="text" id="name" name="fname" placeholder="Enter Full Name"/>
          </div><br></br><br></br>
          <div className="form-element">
            <input type="text" id="email" name="email" placeholder="Enter Email ID"/>
          </div><br></br><br></br>
          <div className="form-element">
            <input type="text" id="phone" name="phone" placeholder="Enter Phone Number"/>
          </div><br></br><br></br>
          <div className="form-element">
            <input type="password" id="pwd2332" name="pwd332" placeholder="Enter Password" required=""/>
          </div><br></br><br></br>
          <div className="form-element inputValue">
            <input type="password" id="pwd" name="pwd" autocomplete="current-password" required="" placeholder="Enter Confirm Password"/>
              <span><i class="far fa-eye" id="togglePassword"></i></span>
          </div><br></br><br></br>
          <div className="form-element">
              <button onclick="add()">Submit</button>
          </div>
        </form>
      </div>
    );
  }
}

export default App;
